import './header.css';

export class HeaderSection extends React.Component {

	render() {

		return(
			<section className='header-container'>
				<div className='header-bio'>
				</div>
				<div className='header-greeting'>
				</div>				
			  <h1>Hello!</h1>			 
			</section>
		)

	}

}
